import { Container, Row, Col, Button } from "react-bootstrap";
import NavbarUser from "../components/navbar/NavbarUser";

function Complain() {
  return (
    <>
      <NavbarUser />
      <Container>
        <div className="mt-5 f-1">
          <h2>Book List</h2>
        </div>
        <div className="text-end mt-5" />
      </Container>
    </>
  );
}

export default Complain;
